import React from "react";
import { Route, Switch } from 'react-router-dom';
import styled,{ ThemeProvider } from "styled-components";


import Home from "./Home";

function App() {
  return (

      <div className="App">
        <Container>
          <Switch>
            <Route path="/" exact component={Home} />
          </Switch>
        </Container>
      </div>

  );
}

const Container = styled.div`
margin-top: 40px;
padding: 0 30px;
`;

export default App;
